-- municipios brasil
INSERT INTO municipio (id_estado, nome, rowinfo)
SELECT e.id, 'Acrelândia' AS nome_cidade, 'SYSTEM_STARTUP' AS rowinfo
FROM pais p
    LEFT JOIN estado e ON (e.id_pais = p.id)
WHERE p.constante_textual_nome = 'NOME_PAIS_BRASIL' AND e.nome = 'Acre';

